interface Circle {
  kind: 'circle'
  radius: number
}           

interface Square {
  kind: 'square'
  width: number
  height: number
}           

const calculateArea = (shape: Circle | Square): number => {
  if (shape.kind === 'circle') {
    return Math.PI * shape.radius * shape.radius
  } else {
    return shape.width * shape.height
  }}

